import { Row, Col } from 'antd';

const AboutMe = () => {
  return (
    <Row>
        <Col span={8}>123</Col>
        <Col span={16}>
            <span>
                I am currently an undergraduate student at University of Southern California, pursuing a bachelor degree in Computer Science, 
                and a minor in Applied Analytics. My fields of interest are video game development, data engineering, and web technology.
            </span>
        </Col>
    </Row>
  );
};

export default AboutMe;
